<?php

$data = "



";

$keys = [['X', 'X', '1', 'X', 'X'],
		 ['X', '2', '3', '4', 'X'],
		 ['5', '6', '7', '8', '9'],
		 ['X', 'A', 'B', 'C', 'X'], 
		 ['X', 'X', 'D', 'X', 'X']];

$x = 2;
$y = 2;

$x_max = 2;
$y_max = 2;

$instructions = explode("\n", $data);

foreach ($instructions as &$singleLine)
{
	$x = 2;
	$y = 2;
	for	($i = 0; $i < strlen($singleLine); $i++ )
	{
		$limit = abs((2 - $y));
		$x_min = 2 - (2 -$limit);
		$x_max = 2 + (2 -$limit);
			
		$limit = abs((2 - $x));
		$y_min = 2 - (2 -$limit);
		$y_max = 2 + (2 -$limit);
			
		switch ($singleLine[$i])
		{
			case 'U':
				$y--;
				break;
			case 'D':
				$y++;
				break;
			case 'L':
				$x--;
				break;
			case 'R';
				$x++;
				break;
		}
		
		$x = max($x_min, min($x, $x_max));
		$y = max($y_min, min($y, $y_max));
	}
	
	echo $keys[$y][$x];
}


?>
